css:
.github-PrCommitView-container {
  display: flex;
  align-items: center;
  padding: 6px;
  font-size: 13px;
  border: 1px solid transparent;
  border-bottom: none;
}
.github-PrCommitView-container:first-child {
  border-top-left-radius: 0;
  border-top-right-radius: 0;
}
.github-PrCommitView-container:last-child {
  border-bottom: 1px solid transparent;
  border-bottom-left-radius: 0;
  border-bottom-right-radius: 0;
}
.github-PrCommitView-commit {
  flex: 1;
}
.github-PrCommitView-messageHeadline.is-button {
  padding: 0;
  margin-right: 4px;
  background-color: transparent;
  border: none;
  cursor: pointer;
  text-align: left;
  color: #f18260;
}
.github-PrCommitView-messageHeadline.is-button:hover,
.github-PrCommitView-messageHeadline.is-button:focus {
  color: rgba(245, 161, 136, 0.75);
}
.github-PrCommitView-title {
  margin: 0 0 0.25em 0;
  font-size: 1.2em;
  line-height: 1.4;
}
.github-PrCommitView-avatar {
  border-radius: 0;
  height: 16px;
  margin-right: 0.4em;
  width: 16px;
}
.github-PrCommitView-metaText {
  line-height: 16px;
  vertical-align: middle;
  color: rgba(255, 255, 255, 0.5);
}
.github-PrCommitView-moreButton {
  margin: 0 auto 0 6px;
  padding: 0em 0.2em;
  color: rgba(255, 255, 255, 0.5);
  font-style: italic;
  font-size: 0.8em;
  border: 1px solid transparent;
  border-radius: 0;
  background-color: #282828;
}
.github-PrCommitView-moreButton:hover {
  background-color: #353535;
}
.github-PrCommitView-moreText {
  margin-top: 3px;
  padding: 0;
  font-size: inherit;
  font-family: var(--editor-font-family);
  word-wrap: initial;
  word-break: break-word;
  white-space: initial;
  background-color: transparent;
}
.github-PrCommitView-sha {
  margin-left: 6px;
  line-height: 16px;
  vertical-align: middle;
  color: #5293d8;
  font-family: var(--editor-font-family);
}
.github-PrCommitView-sha a {
  color: inherit;
}
